.splus-subscribe-lowercontainer,
.splus-subscribe-members {clear:both;}

.splus-subscribe-members {width:1280px;margin-left:-118px;padding-top: 64px; margin-bottom: 86px;}
.ssm-inner {max-width:100%;width:1020px;margin:0 auto 12px;}

.splus-subscribe-lowercontainer {width:800px;max-width:100%;margin: -60px auto 0;padding-top: 60px;}
.splus-subscribe-lowercontainer hr {clear:both;background:#CCCCCC; margin: 56px 0 60px;}
.splus-subscribe-lowercontainer .showonmobile {display:none;}
.splus-subscribe-lowercontainer h2 {text-transform:uppercase;font-size:30px;padding-bottom:8px;border-bottom:2px solid #FFD62B;}

a.learnmore {color:#C60800;display:inline-block;margin-top:10px;}

.sslc-top {margin-bottom: 39px;}
.sslc-top strong {font-family:"arial",sans-serif;font-size:24px;line-height:26px;color:#000;letter-spacing: -1px;}
.sslc-top sup {font-size: 11px;position: relative;top: -8px;right: -1px;}

.sslc-card {font-family: arial;width:375px;float:left;font-size:16px;color:#000;line-height:24px;}
.sslc-card.right {float:right;}
.sslc-card h3 {font-family: arial;
font-size: 22px;
letter-spacing: -1px; margin-bottom: 6px;}
.sslc-card img {height:226px;width:340px;display:block; margin:0 auto 30px;}
.sslc-card img.m {display:none;}

.splus-subscribe-members h2 {text-align:center;text-transform:uppercase;font-size:30px; margin-bottom: 35px;}
.splus-subscribe-members .quotemarks {clear:both;position:relative;}
.splus-subscribe-members .quotemarks.top { margin-bottom: 43px;}
.splus-subscribe-members .quotemarks.bottom{ padding-top: 12px;}
.splus-subscribe-members .quotemarks img {width:84px !important;height:84px; margin:0 auto; display:block;position:relative;z-index:10;}
.splus-subscribe-members .quotemarks:before {content:"";display:block;position:absolute;top:19px;left:0;width:100%;height:24px;background:url(https://nypost.com/wp-content/uploads/sites/2/2022/05/diagonal-top.png) no-repeat center top;background-size:cover;z-index:9;}
.splus-subscribe-members .quotemarks.bottom:before {background-image:url(https://nypost.com/wp-content/uploads/sites/2/2022/05/diagonal-bottom.png)}

.splus-subscribe-members blockquote {font-weight:bold;font-style:italic;font-size:16px;line-height:20px;width:33.33333%;padding:0 6px;float:left;color:#000;}
.splus-subscribe-members blockquote cite {font-weight:normal;font-style:normal;color:#000;display:block; padding-top:10px;line-height:24px;}

@media screen and (max-width: 1064px) {
.splus-subscribe-members blockquote {width:auto;margin-bottom:30px;}
.splus-subscribe-members {width: auto;margin-left: 0;}
.ssm-inner {width: auto;}
}

@media screen and (max-width: 819px) {
.sslc-card {
width: 300px;
float: none !important;
margin: 0 auto 50px;
max-width: 100%;
}
}

@media screen and (max-width: 767px) {
.splus-subscribe-members .quotemarks.top {
margin-bottom: 27px;
}
.sslc-card {width: auto;}
.sslc-card img {height:auto;width:300px;max-width:100%;margin-bottom:15px;}
.sslc-card img.d {display:none;}
.sslc-card img.m {display:block;width:100%;}

.splus-subscribe-members .quotemarks:before {left: -6%;width: 115%;}

.splus-subscribe-lowercontainer .showonmobile {display:block;}

